// login.component.ts
import { Component } from '@angular/core';
import { UserService } from '../user.service';

@Component({
  selector: 'app-login',
  templateUrl: './login.component.html',
  styleUrls: ['./login.component.css'],
})
export class LoginComponent {
  credentials = {
    email: '',
    password: '',
  };

  constructor(private userService: UserService) { }

  login() {
    this.userService.login(this.credentials).subscribe(response => {
        console.log('Innlogging vellykket:', response);
      },
      (error) => {
        console.error('Innloggingsfeil:', error);
      }
    );
  }
}
<!DOCTYPE html>
<html>
<head>
    <meta charset="utf-8" />
    <title></title>
</head>
<body>
  <!-- login.component.html -->
  <form (ngSubmit)="login()">
    <label for="email">Email:</label>
    <input type="email" id="email" [(ngModel)]="credentials.email" name="email" required>

    <label for="password">Password:</label>
    <input type="password" id="password" [(ngModel)]="credentials.password" name="password" required>

    <button type="submit">Log in</button>
  </form>


</body>
</html>
